/* eslint-disable no-undef */
// ==UserScript==
// @name         PL24 Helper - Tweaks
// @namespace    Violentmonkey Scripts
// @version      0.1
// @description  PL24 Helper - Tweaks
// @author       aleves
// @match        https://www.partslink24.com/p5/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=partslink24.com
// @grant        none
// ==/UserScript==
(function()
{
    "use strict";

    const image = new Image();
    image.src = "data:image/png;base64,";

    if (document.querySelector("#search_query"))
    {
        const parentElement = document.querySelector("#companion_search_result [class*=p5_companion_panel_content]");

        const observer = new MutationObserver((mutations) =>
        {
            mutations.forEach((mutation) =>
            {
                if (mutation.addedNodes.length || mutation.removedNodes.length)
                {
                    const childDiv = document.querySelector(".p5_companion_msg_container");

                    if (childDiv)
                    {
                        image.style.transform = "translateY(100%)";

                        document.body.appendChild(image);

                        setTimeout(() =>
                        {
                            image.style.transform = "translateY(0)";
                        }, 100);

                        image.addEventListener("click", () =>
                        {
                            image.style.transform = "rotateZ(-15deg)";

                            setTimeout(() =>
                            {
                                image.style.transform = "translateY(100%) rotateZ(15deg)";
                                setTimeout(() =>
                                {
                                    image.remove();
                                }, 300);
                            }, 300);
                        });
                    }
                    else
                    {
                        image.style.transform = "translateY(100%)";
                        setTimeout(() =>
                        {
                            image.remove();
                        }, 300);
                    }
                }
            });
        });

        observer.observe(parentElement, { childList: true });

        image.style.position = "absolute";
        image.style.bottom = "0";
        image.style.left = "0";
        image.style.width = "25%";
        image.style.maxHeight = "100vh";
        image.style.objectFit = "contain";
        image.style.transform = "translateY(100%)";
        image.style.transition = "transform 0.3s";

        const style = document.createElement("style");
        style.textContent = `
  body {
    margin: 0;
  }
`;

        document.head.appendChild(style);

    }
})();